import React, { useState, useEffect } from 'react';
import "./indexview.css";

const IndexView = () => {
    const [indexView, setIndexlist] = useState(null);
  
    useEffect(() => {
        getIndexView();
    }, []);

    const getIndexView = async () => {
        const response = await fetch("https://www.thequint.com/api/v1/stories");
        const data = await response.json();
    
        setIndexlist(data.stories);
      };

      return (
        <div>
          {
            indexView && indexView.map((item, index) => <div key={index} className="index-name"> ${item.headline} </div>)
          }
        </div>
      );
    };
    
    export default IndexView;
